import { Link } from "react-router-dom";

function Navigation(){
    const onLogOutClick = () =>{
        setIsLoggedIn(false)
    }
    return(
    <>
        <ul>
            <li><Link to="/todo">Todo</Link></li>
            <li><Link to="/">Logout</Link></li>
        </ul>
    </>
    )
}

export default Navigation;
